import './App.css';

function App() {
  return (
    <div className="App">
      {<CryptoTable />}
    </div>
  );
}
export default App;


function CryptoTable() {

  const [data, setData] = useState("");

  async function fetchData() {
    res = await fetch("http://localhost:8080/ExcerciseThursday/api/crypto");
    res.json().then(res => setData(res));
    console.log(data);
  }

  useEffect(() => {
    fetchData()
  }, []);

  return (
    <div>TRXTUSD {data.TRXTUSD}test</div>
  )
}


